import React from "react";
import "./Topnav.css";
import logo from "../images/logo.png";
import CallIcon from "@material-ui/icons/Call";
import WhatsAppIcon from "@material-ui/icons/WhatsApp";
import EmailIcon from "@material-ui/icons/Email";
import TwitterIcon from "@material-ui/icons/Twitter";
import InstagramIcon from "@material-ui/icons/Instagram";
import PersonAddIcon from "@material-ui/icons/PersonAdd";
import AppBar from "@material-ui/icons/PersonAdd";

function Topnav() {
  return (
    <div className='topnav border-bottom shadow-sm position="fixed" bg-white'>
      <div className='container'>
        <div className='row align-items-center pt-2'>
          <nav className='topnav__logo navbar  p-0 ml-3'>
            <a className='navbar-brand m-0' href='/'>
              <img
                className='d-inline-block align-top'
                src={logo}
                alt='Passaggregate logo'
              />
            </a>
          </nav>

          <div className='topnav__enquiries d-flex flex-row align-items-center mx-auto border-left border-right'>
            <a color='secondary' href='tel:+2348062820377'>
              <CallIcon style={{ fontSize: 15 }} />
            </a>

            <a color='secondary' href='/'>
              <WhatsAppIcon style={{ fontSize: 15 }} />
            </a>

            <a color='secondary' href='/'>
              <EmailIcon style={{ fontSize: 15 }} />
            </a>
            <a color='secondary' href='/'>
              <TwitterIcon style={{ fontSize: 15 }} />
            </a>

            <a color='secondary' href='/'>
              <InstagramIcon style={{ fontSize: 15 }} />
            </a>
          </div>

          <div className='topnav__auth mr-3'>
            <a color='secondary' href='/'>
              <PersonAddIcon style={{ fontSize: 20 }} />
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Topnav;
